import React from "react";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";

export default function SignUpPart2() {
  return (
    <div class="login-header">
      <h2>Complete Profile Info</h2>
      <form method="post">
        <input
          id="login-box"
          type="email"
          name="email"
          placeholder="email"
          required
        ></input>
        <br />
        <input
          id="login-box"
          type="tel"
          name="phone"
          pattern="[0-9]{3}-[0-9]{2}-[0-9]{3}"
          placeholder="new password"
          required
        ></input>
        <br />
        <button type="submit">Finish Sign Up</button>
      </form>
    </div>
  );
}
